import logo from './logo.svg';
import './App.css';
import SignUp from './Components/SignUp';
import { BrowserRouter, Routes, Route, Outlet } from 'react-router-dom';

function App() {
  return (
   <>
   <BrowserRouter>
   <Routes>
   {/* <SignUp></SignUp> */}
   <Route path="/">
    <Route path="/signup" component={<SignUp/>}></Route>
   </Route>
  </Routes>
   </BrowserRouter>
   <Outlet/>
   </>
  );
}

export default App;
